import React, { useState } from "react";
import Confirmation from './Confirmation.js';

const Checkout = ({ cart, cartTotal, onReturnClick }) => {
    const [name, setName] = useState(""); // State variable to store the name
    const [email, setEmail] = useState(""); // Store the email
    const [card, setCard] = useState(""); // Store the card info
    const [address, setAddress] = useState(""); // Store the address
    const [city, setCity] = useState(""); // Store the city
    const [state, setState] = useState(""); // Store the state
    const [zip, setZip] = useState(""); // Store the zip code
    const [errors, setErrors] = useState({}); // State variable to store validation errors
    const [orderClicked, setOrderClicked] = useState(false); // State variable to store if order is clicked
    const [confirmationClicked, setConfirmationClicked] = useState(false); // State variable to store if confirmation is clicked

    // Validation functions...
    const validateCard = () => {
        const isValid = /^\d{16}$/.test(card); // Assuming card number is 16 digits
        setErrors((prevErrors) => ({
            ...prevErrors,
            card: isValid ? "" : "Invalid card format",
        }));
    };

    const validateEmail = () => {
        const isValid = /^[^\s@]+@[^\s@]+\.[^\s@]+$/.test(email);
        setErrors((prevErrors) => ({
            ...prevErrors,
            email: isValid ? "" : "Invalid email format",
        }));
    };

    const validateZip = () => {
        const isValid = /(^\d{5}$)|(^\d{5}-\d{4}$)/.test(zip); // Zip code should be 5 digits
        setErrors((prevErrors) => ({
            ...prevErrors,
            zip: isValid ? "" : "Invalid zip code format",
        }));
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        // Validate all fields
        validateEmail();
        validateCard();
        validateZip();

        // Check if there are any errors
        if (Object.values(errors).every((error) => !error)) {
            // No errors, proceed to confirmation
            setConfirmationClicked(true);
        } else {
            // Display error messages
            alert("Wrong input field, check again!");
        }
    };

    return (
        <div className="container">
            {confirmationClicked ? (
                // Render confirmation page
                <Confirmation />
            ) : (
                // Render checkout form
                <form onSubmit={handleSubmit}>
                    <div className="col">
                        <h2>Payment Information</h2>
                        <div className="row mb-3">
                            <div className="col-md-6">
                                <input
                                    type="text"
                                    className="form-control"
                                    placeholder="Enter Full Name"
                                    value={name}
                                    onChange={(e) => setName(e.target.value)}
                                    required
                                />
                            </div>
                            <div className="col-md-6">
                                <input
                                    type="email"
                                    className="form-control"
                                    placeholder="Email"
                                    value={email}
                                    onChange={(e) => setEmail(e.target.value)}
                                    onBlur={validateEmail}
                                    required
                                />
                            </div>
                        </div>

                        <div className="row mb-3">
                            <div className="col-md-6">
                                <input
                                    type="text"
                                    className="form-control"
                                    placeholder="Address"
                                    value={address}
                                    onChange={(e) => setAddress(e.target.value)}
                                    required
                                />
                            </div>
                            <div className="col-md-6">
                                <input
                                    type="text"
                                    className="form-control"
                                    placeholder="City"
                                    value={city}
                                    onChange={(e) => setCity(e.target.value)}
                                    required
                                />
                            </div>
                        </div>

                        <div className="row mb-3">
                            <div className="col-md-6">
                                <input
                                    type="text"
                                    className="form-control"
                                    placeholder="State"
                                    value={state}
                                    onChange={(e) => setState(e.target.value)}
                                    required
                                />
                            </div>
                            <div className="col-md-6">
                                <input
                                    type="text"
                                    className="form-control"
                                    placeholder="Zip Code"
                                    value={zip}
                                    onChange={(e) => setZip(e.target.value)}
                                    onBlur={validateZip}
                                    required
                                />
                            </div>
                        </div>

                        <div className="row mb-3">
                            <div className="col-md-6">
                                <input
                                    type="number"
                                    className="form-control"
                                    placeholder="Card information"
                                    value={card}
                                    onChange={(e) => setCard(e.target.value)}
                                    onBlur={validateCard}
                                    required
                                />
                            </div>
                        </div>

                        <button type="submit" className="btn btn-primary">Order</button>
                    </div>
                </form>
            )}
        </div>
    );
};

export default Checkout;
